import styled from "styled-components";

import { IBenefit, IReward, ICoupon } from "@interfaces";
import { enumTypes } from "@configs";
import { ComponentHistoryCoupon } from "./Coupon";
import { ComponentHistoryBenefit } from "./Benefit";
import { ComponentHistoryReward } from "./Reward";
// import { CouponItem } from "./Item";

interface IProps {
    data: (IBenefit | IReward | ICoupon)[];
    handleClick: (id: string) => void;
}

export const ComponentHistoryList = (props: IProps) => {
    const { data, handleClick } = props;
    const render = (dataItem: IBenefit | IReward | ICoupon) => {
        switch (dataItem.type) {
            case enumTypes.COUPON:
                return <ComponentHistoryCoupon data={dataItem as ICoupon} key={dataItem._id} />;
            case enumTypes.BENEFIT:
                return <ComponentHistoryBenefit data={dataItem as IBenefit} key={dataItem._id} />;
            case enumTypes.REWARD:
                return <ComponentHistoryReward data={dataItem as IReward} key={dataItem._id} />;
            default:
                return <></>;
                break;
        }
    };
    return (
        <StyledContainer>
            {data.map((item) => {
                return render(item);
            })}
        </StyledContainer>
    );
};

const StyledContainer = styled.div`
    width: 90%;
    margin: 0 auto;
    padding: 25px 0;
    position: relative;
`;
